import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.css';
// import './styles.css'
import arrow from '../images/arrow-left.svg'


const Nav = () => {

  

  return (
    <>
    <a class="icon-link icon-link-hover" href="#">
  Icon link
  <svg class="bi" aria-hidden="true"><use xlinkHref="#arrow-right"></use></svg>
</a>
        <Link to={"/"}><h3 className="text-center pt-5 pb-2 text-decoration-none">back</h3></Link>
        <img src="../images/arrow-left.svg/" alt="Bootstrap" width="32" height="32"/>
    </>
  )
}

export default Nav;
